      chapters: `[{"key":"0","label":"Wprowadzenie do Node.js","data":"Documents Folder","icon":"pi pi-fw pi-inbox","children":[{"key":"0-0","label":"Historia i geneza","data":"<p><strong>Node.js</strong> to środowisko uruchomieniowe oparte na silniku JavaScript V8 od Google. Jego historia sięga początku lat 2000, kiedy to Ryan Dahl, twórca Node.js, zaczął rozważać nowe podejście do budowy skalowalnych aplikacji sieciowych.</p>","type":"text","icon":"pi pi-fw pi-file-o"}]},{"key":"1","label":"Środowisko pracy z Node.js","data":"Documents Folder","icon":"pi pi-fw pi-inbox","children":[{"key":"1-0","label":"Wybór wersji Node.js","data":"<p>Wybór odpowiedniej wersji Node.js jest ważny, aby zapewnić zgodność aplikacji z wymaganiami projektu. Poniżej znajdziesz wskazówki dotyczące wyboru wersji Node.js:</p><p><br></p><h3><span style=\\"color: var(--tw-prose-bold);\\">Stabilna wersja (LTS - Long Term Support):</span></h3><ul><li class=\\"ql-indent-1\\">Rekomendowane jest używanie stabilnej wersji LTS do większości projektów produkcyjnych.</li><li class=\\"ql-indent-1\\">Wersje LTS otrzymują długoterminowe wsparcie w postaci aktualizacji zabezpieczeń i stabilności</li></ul><h3><br></h3><h3><span style=\\"color: var(--tw-prose-bold);\\">Aktualna wersja (Current):</span></h3><ul><li class=\\"ql-indent-1\\">Aktualna wersja zawiera najnowsze funkcje i ulepszenia, ale może być mniej stabilna niż wersje LTS.</li><li class=\\"ql-indent-1\\">Nadaje się do projektów, które chcą korzystać z najnowszych funkcji Node.js i nie boją się ewentualnych zmian.</li></ul><p><br></p>","type":"text","icon":"pi pi-fw pi-file-o"}]},{"key":"2","label":"Podstawy Node.js","data":"Documents Folder","icon":"pi pi-fw pi-inbox","children":[{"key":"2-0","label":"Obsługa plików i katalogów","data":"<p><span style=\\"color: var(--tw-prose-bold);\\">Operacje na katalogach w Node.js</span> umożliwiają manipulację strukturą katalogów, co jest istotne przy organizacji plików w projektach. Poniżej przedstawiono przykładowe operacje:</p><ol><li><span style=\\"color: var(--tw-prose-bold);\\">Tworzenie katalogu:</span></li></ol><ul><li class=\\"ql-indent-1\\">Funkcja <code>fs.mkdir</code> umożliwia tworzenie nowych katalogów.</li></ul><pre class=\\"ql-syntax\\" spellcheck=\\"false\\">\\nfs.mkdir('nowyKatalog', (err) =&gt; { if (err) throw err; console.log('Katalog został utworzony!'); }); \\n</pre><ol><li><span style=\\"color: var(--tw-prose-bold);\\">Odczyt zawartości katalogu:</span></li></ol><ul><li class=\\"ql-indent-1\\">Funkcja <code>fs.readdir</code> pozwala na odczyt listy plików w danym katalogu.</li></ul><pre class=\\"ql-syntax\\" spellcheck=\\"false\\">\\nfs.readdir('nazwaKatalogu', (err, files) =&gt; { if (err) throw err; console.log('Zawartość katalogu:', files); }); \\n</pre><ol><li><span style=\\"color: var(--tw-prose-bold);\\">Usuwanie katalogu:</span></li></ol><ul><li class=\\"ql-indent-1\\">Funkcja <code>fs.rmdir</code> usuwa katalog. Pamiętaj, że katalog musi być pusty przed usunięciem.</li></ul><pre class=\\"ql-syntax\\" spellcheck=\\"false\\">\\nfs.rmdir('katalogDoUsuniecia', (err) =&gt; { if (err) throw err; console.log('Katalog został usunięty!'); });\\n</pre><p><br></p>","type":"text","icon":"pi pi-fw pi-file-o"}]}]`
