      chapters: `[{"key":"0","label":"Charakterystyka Kuchni Włoskiej","data":"Documents Folder","icon":"pi pi-fw pi-inbox","children":[{"key":"0-0","label":"Regiony i Różnorodność","data":"<p>Kuchnia włoska jest jedną z najbardziej różnorodnych i cenionych na świecie. To kulinarne bogactwo wynika z regionalnych różnic, gdzie każdy obszar Włoch ma swoje unikalne tradycje, składniki i smaki. Północne regiony, takie jak Lombardia, słyną z potraw opartych na śmietanie i masłach, podczas gdy środkowe regiony, w tym Toskania, są znane z prostych, ale smacznych dań z oliwy z oliwek. Na południu, takim jak Sycylia, dominuje świeżość owoców morza i wpływy kuchni śródziemnomorskiej.</p>","type":"text","icon":"pi pi-fw pi-file-o"}]},{"key":"1","label":"Makaron we Włoskiej Kuchni","data":"Documents Folder","icon":"pi pi-fw pi-inbox","children":[{"key":"1-0","label":"Różnorodność Makaronów","data":"<p>Makaron, zwany w języku włoskim \\"pasta\\", jest nieodłączną częścią kuchni włoskiej. Istnieje ogromna różnorodność kształtów i rodzajów makaronów, a każdy z nich ma swoje unikalne zastosowanie. Spaghetti, fettuccine, penne, ravioli - to tylko kilka przykładów. Każdy kształt makaronu może znaleźć swoje idealne zastosowanie w konkretnej potrawie, co czyni go niezwykle wszechstronnym składnikiem.</p>","type":"text","icon":"pi pi-fw pi-file-o"}]}]`
